core::iter::Iterator::position.doc:
Searches for an element in an iterator, returning its index.

`position()` takes a closure that returns `true` or `false`. It applies
this closure to each element of the iterator, and if one of them
returns `true`, then `position()` returns [`Some(index)`]. If all of
them return `false`, it returns [`None`].

`position()` is short-circuiting; in other words, it will stop
processing as soon as it finds a `true`.

# Overflow Behavior

The method does no guarding against overflows, so if there are more
than [`usize::MAX`] non-matching elements, it either produces the wrong
result or panics. If overflow checks are enabled, a panic is
guaranteed.

# Panics

This function might panic if the iterator has more than `usize::MAX`
non-matching elements.

[`Some(index)`]: Some

# Examples

Basic usage:

```
let a = [1, 2, 3];

assert_eq!(a.into_iter().position(|x| x == 2), Some(1));

assert_eq!(a.into_iter().position(|x| x == 5), None);
```

Stopping at the first `true`:

```
let a = [1, 2, 3, 4];

let mut iter = a.into_iter();

assert_eq!(iter.position(|x| x >= 2), Some(1));

// we can still use `iter`, as there are more elements.
assert_eq!(iter.next(), Some(3));

// The returned index depends on iterator state
assert_eq!(iter.position(|x| x == 4), Some(0));

```

core::option::Option::<T>::and_then.doc:
Returns [`None`] if the option is [`None`], otherwise calls `f` with the
wrapped value and returns the result.

Some languages call this operation flatmap.

# Examples

```
fn sq_then_to_string(x: u32) -> Option<String> {
    x.checked_mul(x).map(|sq| sq.to_string())
}

assert_eq!(Some(2).and_then(sq_then_to_string), Some(4.to_string()));
assert_eq!(Some(1_000_000).and_then(sq_then_to_string), None); // overflowed!
assert_eq!(None.and_then(sq_then_to_string), None);
```

Often used to chain fallible operations that may return [`None`].

```
let arr_2d = [["A0", "A1"], ["B0", "B1"]];

let item_0_1 = arr_2d.get(0).and_then(|row| row.get(1));
assert_eq!(item_0_1, Some(&"A1"));

let item_2_0 = arr_2d.get(2).and_then(|row| row.get(0));
assert_eq!(item_2_0, None);
```

core::ops::Try::branch.doc:
Used in `?` to decide whether the operator should produce a value
(because this returned [`ControlFlow::Continue`])
or propagate a value back to the caller
(because this returned [`ControlFlow::Break`]).

# Examples

```
#![feature(try_trait_v2)]
use std::ops::{ControlFlow, Try};

assert_eq!(Ok::<_, String>(3).branch(), ControlFlow::Continue(3));
assert_eq!(Err::<String, _>(3).branch(), ControlFlow::Break(Err(3)));

assert_eq!(Some(3).branch(), ControlFlow::Continue(3));
assert_eq!(None::<String>.branch(), ControlFlow::Break(None));

assert_eq!(ControlFlow::<String, _>::Continue(3).branch(), ControlFlow::Continue(3));
assert_eq!(
    ControlFlow::<_, String>::Break(3).branch(),
    ControlFlow::Break(ControlFlow::Break(3)),
);
```

core::ops::FromResidual::from_residual.doc:
Constructs the type from a compatible `Residual` type.

This should be implemented consistently with the `branch` method such
that applying the `?` operator will get back an equivalent residual:
`FromResidual::from_residual(r).branch() --> ControlFlow::Break(r)`.
(The residual is not mandated to be *identical* when interconversion is involved.)

# Examples

```
#![feature(try_trait_v2)]
use std::ops::{ControlFlow, FromResidual};

assert_eq!(Result::<String, i64>::from_residual(Err(3_u8)), Err(3));
assert_eq!(Option::<String>::from_residual(None), None);
assert_eq!(
    ControlFlow::<_, String>::from_residual(ControlFlow::Break(5)),
    ControlFlow::Break(5),
);
```

